INSERT INTO `wp_postmeta` VALUES (903,45,'benefit_information_0_icon_text','You don\'t have to be a window washer at the Empire State Building to need accidental death insurance. Every person alive is at risk. Are your loved ones financially prepared for the costs of an unexpected funeral?\r\n\r\n&nbsp;');
