INSERT INTO `wp_postmeta` VALUES (911,45,'benefit_information_0_optional_description','<em>\"My husband, Stephen Morris, had a decent job, a loving family and even a little in savings. When Stephen passed unexpectedly in a car accident, we were left to cover all of the costs.\" -- Kaitlynn Morris</em>\r\n\r\n[column size=\"1/2\"]\r\n\r\n&nbsp;\r\n\r\nAccidental death and dismemberment insurance, also known as AD&amp;D insurance, is supplementary coverage that offers extra protection for you and your family.\r\n\r\n[end_column]\r\n\r\n[column size=\"1/2\"]\r\n\r\n&nbsp;\r\n<ul>\r\n 	<li>Coverage is provided immediately as a program benefit at no additional charge</li>\r\n 	<li>Acceptance is guaranteed, no physical exam required</li>\r\n 	<li>Your coverage cannot be cancelled as long as you are a member and your sponsoring organization offers this program</li>\r\n</ul>\r\n[end_column]\r\n\r\n&nbsp;');
INSERT INTO `wp_postmeta` VALUES (912,45,'_benefit_information_0_optional_description','field_54c85ad231c6f');
INSERT INTO `wp_postmeta` VALUES (913,45,'benefit_information_0_read_more_content','With this essential benefit, greatly ease your financial burden in the event of a death or dismemberment resulting from an accident, while saving the $10.00 to $15.00 annual premium typically payable for this type of coverage.');
