INSERT INTO `wp_postmeta` VALUES (1265,100,'benefit_information_0_icon_text','\"<em>I was shocked by the amount of money we saved on our last family vacation. We rented a car, stayed at a nice hotel and visited the amusement park, and it cost less than any of our other vacations.\"\r\n</em>-Sarah Albright');
