INSERT INTO `wp_postmeta` VALUES (1270,100,'_benefit_information_0_subtitle_description','field_54c85a8a31c6d');
INSERT INTO `wp_postmeta` VALUES (1271,100,'benefit_information_0_callout_text','Members can save up to hundreds of dollars on dining, shopping, traveling and more. Use our mobile app to save on-the-go.');
INSERT INTO `wp_postmeta` VALUES (1272,100,'_benefit_information_0_callout_text','field_54c85aab31c6e');
INSERT INTO `wp_postmeta` VALUES (1273,100,'benefit_information_0_optional_description','<p style=\"text-align: left;\"><strong>With your membership, you will receive:</strong></p>\r\n<p style=\"text-align: left;\"><strong>Retail &amp; Restaurant Savings</strong>\r\nGet access to a dynamic shopping program which will reward you every time you use it. Find great deals at hundreds of popular merchants and restaurants. Customers will find coupons and free shipping offers from top retailers and brands online. They will also receive discounts in stores and restaurants with mobile or print coupons.</p>\r\n<p style=\"text-align: left;\"><strong>Grocery Coupons</strong>\r\nSave on groceries, home and health-care products, pet products, supplies and more from trusted brands at top stores.</p>\r\n<p style=\"text-align: left;\"><strong>Big Savings on Attractions</strong>\r\nSave at major theme parks around the country. Plus, save off the box office price by purchasing movie tickets in advance for leading theaters.</p>\r\n<p style=\"text-align: left;\"><strong>Save 10% or more on Select Hotel Chains or More at Hundreds of Locations Nationwide</strong>\r\nWhether it’s a weekend getaway or family vacation, use these great discounts to save on your trip planning.</p>\r\n<p style=\"text-align: left;\"><strong>Other Travel Savings</strong>\r\nYou can save up to 20% on rental cars and even more on cruises and vacation packages, simply by calling the toll-free numbers.</p>');
INSERT INTO `wp_postmeta` VALUES (1274,100,'_benefit_information_0_optional_description','field_54c85ad231c6f');
INSERT INTO `wp_postmeta` VALUES (1275,100,'benefit_information_0_read_more_content','Whether it\'s a weekend staycation or your annual family vacation, you can\'t afford to let these savings pass you by.');
