INSERT INTO `wp_postmeta` VALUES (1317,103,'benefit_information_0_icon_text','<em>\"I signed up for LifeLock a few months ago, and </em><em>they\'ve already helped me avoid one theft </em><em>attempt. I was immediately alerted, and they </em><em>helped replace my credit card that very day. I feel </em><em>100% confident in this program.\"\r\n-Britney Burnett</em>');
