INSERT INTO `wp_postmeta` VALUES (1323,103,'benefit_information_0_callout_text','It is figured that the majority of identity theft incidents (85%) involved the fraudulent use of existing account information, such as credit card or bank account information.');
INSERT INTO `wp_postmeta` VALUES (1324,103,'_benefit_information_0_callout_text','field_54c85aab31c6e');
INSERT INTO `wp_postmeta` VALUES (1325,103,'benefit_information_0_optional_description','<p style=\"text-align: left;\">In this age, we are more vulnerable than ever to identity theft. This means it is more important than ever to get the trusted protection for you and your family members. LifeLock gives you comprehensive protection from identity theft and fraudulent activity. With LifeLock, you receive:</p>\r\n<p style=\"text-align: left;\">·      Protection of your personal information from identity thieves\r\n·      Alerts for fraudulent activity like credit card and loan applications\r\n·      The monitoring of over 10,000 black market websites for illegal selling of your information\r\n·      Credit card replacement or cancellation due to loss\r\n·      40% off per month for LifeLock Standard™ or 15%  off per month for LifeLock Ultimate Plus™</p>\r\n<p style=\"text-align: left;\"></p>');
INSERT INTO `wp_postmeta` VALUES (1326,103,'_benefit_information_0_optional_description','field_54c85ad231c6f');
INSERT INTO `wp_postmeta` VALUES (1327,103,'benefit_information_0_read_more_content','<p style=\"text-align: center;\">If you select LifeLock Ultimate Plus™, they’ll also help you monitor your savings and checking accounts for takeover fraud* and provide online access to your annual credit reports and monthly score tracker. You can receive one LifeLock Standard™ membership per account at a 40% discount. The LifeLock UltimatePlus™ plan is available at a 15% discount off the membership price. You can also enroll additional household members and get a 10% discount off the membership list price of either service. <em>*Requires separate enrollment.</em></p>');
INSERT INTO `wp_postmeta` VALUES (1328,103,'_benefit_information_0_read_more_content','field_54c85b2931c70');
INSERT INTO `wp_postmeta` VALUES (1329,52,'benefit_information_1_icon','164');
INSERT INTO `wp_postmeta` VALUES (1330,52,'_benefit_information_1_icon','field_54c85a4531c6a');
INSERT INTO `wp_postmeta` VALUES (1331,52,'benefit_information_1_icon_text','\"<em>When my aunt passed away a few years ago, I saw the hardship it brought my uncle. Her records were scattered, and information was missing. I\'ve definitely learned to avoid the same situation.\"\r\n</em>-Ben Thomas\r\n\r\n<a href=\"https://vimeo.com/user39246495/review/124830745/c432ca02ff\" target=\"_blank\" rel=\"noopener\">Watch Video</a>');
INSERT INTO `wp_postmeta` VALUES (1332,52,'_benefit_information_1_icon_text','field_54c85a5a31c6b');
