INSERT INTO `wp_postmeta` VALUES (1335,52,'benefit_information_1_subtitle_description','Would your loved ones know how to settle your affairs if you died or became incapacitated?');
INSERT INTO `wp_postmeta` VALUES (1336,52,'_benefit_information_1_subtitle_description','field_54c85a8a31c6d');
INSERT INTO `wp_postmeta` VALUES (1337,52,'benefit_information_1_callout_text','According to multiple studies, it is estimated that less than 1 in 5 Americans have all of their personal information adequately organized in one place.');
INSERT INTO `wp_postmeta` VALUES (1338,52,'_benefit_information_1_callout_text','field_54c85aab31c6e');
INSERT INTO `wp_postmeta` VALUES (1339,52,'benefit_information_1_optional_description','<p style=\"text-align: left;\">Gain peace of mind for you and your loved ones from the convenience of your personal computer. Organize, record and document personal, medical and financial information with your Living Family Journal software program. Keep track of and easily update:</p>\r\n\r\n<div style=\"text-align: left;\">\r\n\r\n[column size=\"1/2\"]\r\n\r\n·      Personal Information\r\n·      Medical Information\r\n·      Legal Information\r\n·      Financial Information\r\n\r\n[end_column]\r\n\r\n[column size=\"1/2\"]\r\n\r\n·      Real Estate Information\r\n·      Emergency Contacts\r\n·      Funeral Arrangements\r\n\r\n[end_column]\r\n\r\n&nbsp;\r\n\r\n</div>');
