INSERT INTO `wp_postmeta` VALUES (1367,105,'benefit_information_0_optional_description','By enrolling in this package of benefits through your financial institution, you become eligible for a complimentary Identity IQ Protect Max membership.  This is an OPTIONAL service and requires separate enrollment on your behalf.  Your membership in this package does not automatically include an Identity IQ Protect Max membership.\r\n\r\nIdentityIQ provides you with the financial peace of mind, making you and informed and proactive consumer with a team of experts to support you. Know what is in your credit reports at the major credit reporting agencies. Watch for changes in your credit score and receive alerts if something changes in your credit file. Plan your best defense with our identity theft restoration products, like insurance, and services.\r\n\r\n[column size=\"1/2\"]\r\n<em>With IdentityIQ Protect Max, you receive:</em>\r\n<ul>\r\n 	<li><em>3 Bureau Daily Credit Monitoring &amp; Alerts</em></li>\r\n 	<li><em>3 Bureau Credit Report &amp; Score (Quarterly)</em></li>\r\n 	<li><em>Discounted Additional Reports &amp; Scores </em></li>\r\n 	<li><em>$1,000,000 ID Theft Insurance </em></li>\r\n 	<li><em>Credit Score Tracker </em></li>\r\n 	<li><em>ID Fraud Restoration Specialist </em></li>\r\n</ul>\r\n[end_column]\r\n\r\n[column size=\"1/2\" class=\"pt50\"]\r\n<ul>\r\n 	<li><em>Fraud Alert Assistance </em></li>\r\n 	<li><em>Opt-out IQ (Junk Mail/Do Not Call List)</em></li>\r\n 	<li><em>Checking Account Report </em></li>\r\n 	<li><em>Lost Wallet Form &amp; Assistance </em></li>\r\n 	<li><em>Credit Score Simulator </em></li>\r\n 	<li><em>IQ Center </em></li>\r\n</ul>\r\n[end_column]');
