INSERT INTO `wp_postmeta` VALUES (1562,135,'title_description','In life, peace of mind and protection are key. With these two features you can save over $100 a year in benefits that will give you and your family the security you need.');
INSERT INTO `wp_postmeta` VALUES (1563,135,'_title_description','field_54c8596b31c67');
INSERT INTO `wp_postmeta` VALUES (1564,135,'benefit_image','86');
INSERT INTO `wp_postmeta` VALUES (1565,135,'_benefit_image','field_54c859c931c68');
INSERT INTO `wp_postmeta` VALUES (1566,135,'benefit_information_0_icon','96');
INSERT INTO `wp_postmeta` VALUES (1567,135,'_benefit_information_0_icon','field_54c85a4531c6a');
INSERT INTO `wp_postmeta` VALUES (1568,135,'benefit_information_0_icon_text','Identity thieves steal mail, skim credit cards, hack into ATMs and rummage through garbage in the search for their next victim. In the blink of an eye, criminals misuse bits and pieces of your personal information to obtain fraudulent credit and make unauthorized purchases.\r\n\r\nNo matter what stage you are in life, your identity will always be a prime target for thieves—you may not be aware of it, but the different stages of life put you at risk for different types of identity theft');
INSERT INTO `wp_postmeta` VALUES (1569,135,'_benefit_information_0_icon_text','field_54c85a5a31c6b');
INSERT INTO `wp_postmeta` VALUES (1570,135,'benefit_information_0_subtitle','IDT911\'S LIFESTAGES®');
INSERT INTO `wp_postmeta` VALUES (1571,135,'_benefit_information_0_subtitle','field_54c85a7731c6c');
INSERT INTO `wp_postmeta` VALUES (1572,135,'benefit_information_0_subtitle_description','No additional enrollment required.');
INSERT INTO `wp_postmeta` VALUES (1573,135,'_benefit_information_0_subtitle_description','field_54c85a8a31c6d');
INSERT INTO `wp_postmeta` VALUES (1574,135,'benefit_information_0_callout_text','Identity thieves are smart. We’re smarter.  Just as we rely on technology to make our lives easier, thieves and criminals rely on the same technology to steal personal information and commit fraudulent crimes. Protecting your identity is our priority!');
INSERT INTO `wp_postmeta` VALUES (1575,135,'_benefit_information_0_callout_text','field_54c85aab31c6e');
INSERT INTO `wp_postmeta` VALUES (1576,135,'benefit_information_0_optional_description','<em>\"What most people think is private is probably public. Last year, my personal information was stolen and used. I was totally unprepared, and it was a mess to resolve.\" -- Jeff Manziel</em>\r\n\r\n[column size=\"1/2\"  class=\"pt50\"]\r\n\r\n<strong>Don’t wait until you’re a victim.</strong>\r\n\r\nIf you want more identity theft information or think you might be a victim of identity theft, you simply call us at a toll free number and you will be transferred to your personal-touch fraud specialist at IDT911\'s Resolution Center.  There is no added cost to you for these services, no matter how often you talk to a fraud specialist.\r\n\r\n[end_column][column size=\"1/2\"  class=\"pt50\"]\r\n\r\nOur LifeStages® services focus on these different stages of life:\r\n<ul>\r\n	<li><strong>For those under 18</strong> – children often have just the right combination for identity thieves: a Social Security number and clean, or nonexistent credit</li>\r\n	<li><strong>In your 20s</strong> – new jobs, new apartments, maybe even a new spouse. It’s easy to lose sight of your identity amid the flurry of fun.</li>\r\n	<li><strong>In your 30s and 40s</strong> – kids, mortgages, car payments. There’s never been so much as stake.</li>\r\n	<li><strong>In your 50s</strong> – Empty nesting, a taste of freedom…and college tuition. Just when things seem to be settling down, new responsibilities and risks kick in.</li>\r\n	<li><strong>In your 60s and up</strong> – whether it’s time for early retirement or running after the grandkids, these can be special years.</li>\r\n</ul>\r\n[end_column]');
INSERT INTO `wp_postmeta` VALUES (1577,135,'_benefit_information_0_optional_description','field_54c85ad231c6f');
INSERT INTO `wp_postmeta` VALUES (1578,135,'benefit_information_0_read_more_content','During any stage of life our personal fraud specialists will guide you through the proactive and resolution process, no matter what your identity issue is, until your problem is fully resolved and your peace of mind is restored.');
INSERT INTO `wp_postmeta` VALUES (1579,135,'_benefit_information_0_read_more_content','field_54c85b2931c70');
INSERT INTO `wp_postmeta` VALUES (1580,135,'benefit_information_1_icon','89');
INSERT INTO `wp_postmeta` VALUES (1581,135,'_benefit_information_1_icon','field_54c85a4531c6a');
INSERT INTO `wp_postmeta` VALUES (1582,135,'benefit_information_1_icon_text','\"<em>When my aunt passed away a few years ago, I saw the hardship it brought my uncle. Her records were scattered, and information was missing. I\'ve definitely learned to avoid the same situation.\"\r\n</em>-Ben Thomas');
INSERT INTO `wp_postmeta` VALUES (1583,135,'_benefit_information_1_icon_text','field_54c85a5a31c6b');
INSERT INTO `wp_postmeta` VALUES (1584,135,'benefit_information_1_subtitle','LIVING FAMILY JOURNAL ');
INSERT INTO `wp_postmeta` VALUES (1585,135,'_benefit_information_1_subtitle','field_54c85a7731c6c');
INSERT INTO `wp_postmeta` VALUES (1586,135,'benefit_information_1_subtitle_description','Would your loved ones know how to settle your affairs if you died or became incapacitated?');
INSERT INTO `wp_postmeta` VALUES (1587,135,'_benefit_information_1_subtitle_description','field_54c85a8a31c6d');
INSERT INTO `wp_postmeta` VALUES (1588,135,'benefit_information_1_callout_text','According to multiple studies, it is estimated that less than 1 in 5 Americans have all of their personal information adequately organized in one place.');
INSERT INTO `wp_postmeta` VALUES (1589,135,'_benefit_information_1_callout_text','field_54c85aab31c6e');
INSERT INTO `wp_postmeta` VALUES (1590,135,'benefit_information_1_optional_description','<p style=\"text-align: left;\">Gain peace of mind for you and your loved ones from the convenience of your personal computer. Organize, record and document personal, medical and financial information with your Living Family Journal software program. Keep track of and easily update:</p>\r\n\r\n<div style=\"text-align: left;\">\r\n\r\n[column size=\"1/2\"]\r\n\r\n&nbsp;\r\n\r\n·      Personal Information\r\n·      Medical Information\r\n·      Legal Information\r\n·      Financial Information\r\n\r\n[end_column] [column size=\"1/2\"]\r\n\r\n&nbsp;\r\n\r\n·      Real Estate Information\r\n·      Insured Valuables\r\n·      Funeral Arrangements\r\n\r\n[end_column]\r\n\r\n&nbsp;\r\n\r\n</div>\r\n<p style=\"text-align: left;\">Reduce the frustrations associated with disorganization with this comprehensive solution.</p>');
