INSERT INTO `wp_postmeta` VALUES (1746,148,'benefit_information_0_icon_text','Smartphones are expensive to repair, and the costs can add up quickly. Cover your cellular phone from breakage or theft.\r\n\r\n&nbsp;');
INSERT INTO `wp_postmeta` VALUES (1747,148,'_benefit_information_0_icon_text','field_54c85a5a31c6b');
INSERT INTO `wp_postmeta` VALUES (1748,148,'benefit_information_0_subtitle','Cellular Telephone Protection');
INSERT INTO `wp_postmeta` VALUES (1749,148,'_benefit_information_0_subtitle','field_54c85a7731c6c');
INSERT INTO `wp_postmeta` VALUES (1750,148,'benefit_information_0_subtitle_description','Do you have protection for your cellular phone?');
INSERT INTO `wp_postmeta` VALUES (1751,148,'_benefit_information_0_subtitle_description','field_54c85a8a31c6d');
INSERT INTO `wp_postmeta` VALUES (1752,148,'benefit_information_0_callout_text','Phones are easy to break and expensive to replace.  Cases are not enough.');
INSERT INTO `wp_postmeta` VALUES (1753,148,'_benefit_information_0_callout_text','field_54c85aab31c6e');
INSERT INTO `wp_postmeta` VALUES (1754,148,'benefit_information_0_optional_description','This service will reimburse the enrolled accountholder for the damage to or theft of eligible cellular wireless telephones.  Coverage is subject to a fifty dollar co-payment per claim and a maximum of two claims per twelve month period.  The maximum benefit per claim is two hundred and fifty dollars and five hundred dollars per twelve month period.  Other details are provided in the description of coverage.  The cellular telephone bill must be paid out of the eligible account.');
INSERT INTO `wp_postmeta` VALUES (1755,148,'_benefit_information_0_optional_description','field_54c85ad231c6f');
INSERT INTO `wp_postmeta` VALUES (1756,148,'benefit_information_0_read_more_content','Do not leave yourself in a crack, get protection for your cellular phone included with your checking account.');
INSERT INTO `wp_postmeta` VALUES (1757,148,'_benefit_information_0_read_more_content','field_54c85b2931c70');
