INSERT INTO `wp_postmeta` VALUES (7866,450,'benefit_information_0_optional_description','Whenever you travel, you\'ll like the secure feeling that you are protected by the Nation Safe Drivers Auto Club. NSD provides real peace-of-mind with the best service and protection available anywhere.  24 hours a day and 7 days a week coverage includes towing up to 15 miles, roadside assistance, delivery of supplies, tire service, battery service and lockout service.  This coverage covers one person per account on an individual account and the account holder and spouse on a joint account.  Maximum of 3 claims per member per year.  Additional charges may apply for delivery of supplies or towing over 15 miles.\r\n\r\n*<em>Nation Safe Drivers may operate in various states as Nation Motor Club, LLC or Nation Safe Drivers Services, Inc.</em>');
